window.bookSummaryJSON = "<p><b>Will Cora break, or will she bend; is this the beginning, or the end?</b></p> <p>Everything Cora thought she knew about Harrow Faire was a lie. All of it. Now, as the lines in the sand are drawn, as a war for the Heart of the Faire builds, she must discover how much she is willing to sacrifice to save the people she has come to think of as family...and how much of herself she’s willing to give up for the man she has come to love.</p> <p>Mr. Harrow’s boxcar is empty. The doors are blown wide on the tower. Mayhem has come to Harrow Faire. But will this be the end of the circus? Or is every ending only a new beginning?</p>"; 
